import React from "react";
import Table_dar from "./Table_dar"

function Table(){
    return(
        <div className="Parchessi_design border border-dark position-relative">
            <Table_dar classN="Primary-player" bg="var(--primary)" />
            <Table_dar classN="Danger-player"  bg="var(--danger)" />
            <Table_dar classN="Success-player"  bg="var(--success)" />
            <Table_dar classN="Warning-player"  bg="var(--warning)" />

            <div style="position:relative;top:calc(50% - 100px);left:calc(50% - 100px);">  
                <div style="clip-path:polygon(50% 50%, 0% 100%, 100% 100%);" className="bg-success box_center">  </div>
                <div style="clip-path:polygon(50% 50%, 0% 100%, 0 0);" className="bg-danger box_center">  </div>
                <div style="clip-path:polygon(50% 50%, 100% 0, 0 0);" className="bg-primary box_center">  </div>
                <div style="clip-path:polygon(50% 50%, 100% 0, 100% 100%);" className="bg-warning box_center">  </div>
            </div>

        </div>
    )
}

export default Table;
